    "**<center><h1>PREPARE</h1></center>**\n",
    "***\n",
    "\n",
    "## **Key objectives:**\n",
    "\n",
    "#### **1. Determine the credibility of the data**\n",
    "\n",
    "* The data is public data from FitBit Fitness Tracker Data. It's a dataset from thirty fitbit users that includes minute-level output for physical activity, heart rate, and sleep monitoring. It's a good database segmented in several tables with different aspects of the data of the device with lots of details about the user behaviour.\n",
    "\n",
    "**Does it ROCCC?**\n",
    "\n",
    "A credible data source is Reliable, Original, Comprehensive, Current, and Cited (ROCCC).\n",
    "\n",
    "* Reliable: Yes. (Medium)\n",
    "\n",
    "The sample data includes at least 30 individual participants, which meets the generally accepted minimum sample size in statistics. However, the method of data collection is biased, as it only represents the population that has Amazon Mechanical Turk accounts.\n",
    "\n",
    "* Original: Yes. (High)\n",
    "\n",
    "The data was generated by individual Fitbit users who submitted their personal tracker data through Amazon Mechanical Turk.\n",
    "\n",
    "* Comprehensive: Yes. (Medium)\n",
    "\n",
    "The dataset includes daily, hourly, and minute-level data on individual physical activity, heart rate, weight, and sleep monitoring. It also includes individual files for each activity or tracking feature, as well as a summary file. However, it lacks demographic information, which would have been useful for this analysis.\n",
    "\n",
    "* Current: No. (Low)\n",
    "\n",
    "We will continue with the analysis, despite the data being 6 years old and potentially not relevant now, for the purpose of this capstone project.\n",
    "\n",
    "* Cited: Yes. (Medium)\n",
    "\n",
    "The original [dataset](https://zenodo.org/record/53894) source included the Authors, Title, Publication date, DOI (Digital Object Identifier), Source, and File format. It also cited the names of individuals who reviewed the data. However, it does not have a data dictionary. Despite this, it is still easy to understand the information based on the filenames and variable/column names.\n",
    "\n",
    "#### **2. Sort and filter the data**\n",
    "\n",
    "* For this analysis I'm going to focus on the daily timeframe as my analysis is focused on detecting high-level trends in usage, not in the detailed performance of the users. For that the most interesting data for me is all the daily activity and the sleep data as they will probably show some interesting patterns but I'll have to merge some tables together to do my analysis.\n",
    "\n",
    "## **Importing libraries:**"
   ]
