   "source": [
    "## **Analysing the above charts:**\n",
    "* According to the charts(column and boxplot), it seems that the better part of the users are 'sedentary' or 'lightly active' users but it's very interesting to see that even though they are the biggest category the 'fairly active' and most importantly, the 'very active' are the ones with more calories burned. That is not necessarily surprising but it confirms the suspicion that the level of activity directly relates with the calories burned and so it's an important factor in any effort to lose weight."
