    "## **Analysing the above chart:**\n",
    "* This chart(boxplot) represents the calories burned by the three categories of steps based on the summary values and then its faceted by the three categories of distance traveled. I did this to see which aspect is more important to the calories burned, the steps or the distance traveled and here we can see that the most calories burned are the \"6k > & < 10k Steps\" and \"> 7 miles\" which would indicate some kind of running activity that allows the user to traverse more distance with less steps.\n",
    "\n",
    "* Also interesting is the parallelism between the \"> 10k Steps\" in the mean distance category and the \"<6k Steps\" in the low distance category that reinforces the idea that speed is the most important factor in calories burned."
   ]
