   "source": [
    "## **Analysing the above chart:**\n",
    "* This chart(bar) clearly shows the relation between the activity level and sleep quality as in the sedentary users we find the largest percentage of bad sleepers and with some activity (even very little activity) we see a great increase of normal sleepers.\n",
    "\n",
    "* The most unexpected result  was the decrease of over sleepers (more than 8h) in the most active categories which makes sense given the fact that they are people that dont like sticking around in bed for a long time."
   ]
  },
