   "source": [
    "**<center><h1>SHARE</h1></center>**\n",
    "***\n",
    "\n",
    "## **Sharing my conclusions:**\n",
    "\n",
    "There are some interesting insights I found in this data that I think would be helpful when targeting the marketing messages to new customers:\n",
    "* There is a clear relation between higher intensity activity and calories burned so logging the activity with the device could be a good motivator to increase your activity if you have some kind of plan to lose weight.\n",
    "\n",
    "* The data also shows a clear trend of better quality sleep linked to the activity level that would be interesting to improve your sleep and in general to low stress and improving your quality of life.\n",
    "\n",
    "* Bellabeat should encourage more users to participate in sleep and weight logging. Perhaps create some kind of social aspect to the companion app where users can gain accomplishment badges.\n",
    "\n",
    "* The data reveals that lightly activity is dominant both by time and and distance coverered. In [this article](https://www.etsu.edu/exercise-is-medicine/guidelines.php) on the East Tennessee State University, the American College of Sport Medicine recommends moderate-intensity activity for a minimum of 30 minutes OR high-intensity activity for a minimum of 20 minutes, three times per week. Bellabeat should use these standards in designing notifications and reminders for users.\n",
    "\n",
    "With all this in mind I would suggest focusing the marketing messages on the improving sleep and lowering stress and on the fitness/losing weight aspects of the devices as using this device to track your sleep and activity will encourage the user to increase their activities seeing the improvement in their metrics."
   ]
